import { FC } from "react";
import styled from "styled-components";

import { SubtitleProps } from "../interfaces/types";

export const FGSubtitle = styled.h3`
  font-size: ${fontSizeMd};
  line-height: ${lineHeightMedium};
  font-family: ${fontFamilyBase};
  font-weight: ${fontWeightMedium};
  color: ${(props) => (props.color ? props.color : colorNeutral02)};
`;

const SubtitleSmall: FC<SubtitleProps> = (props) => {
  return <FGSubtitle color={props.color}>{props.label}</FGSubtitle>;
};

export default SubtitleSmall;
